HOJS.lib = {
    testReg:function(reg,valiValue){
        function testRegFun(){
            if(reg.test(valiValue)){
                return true;
            }
            else{
                return false;
            }
        }
        
        if(typeof reg == "string")
        {
            reg = new RegExp(reg);
            return testRegFun();
        }
        else if(reg instanceof RegExp){
            return testRegFun();
        }
        else{
            console.debug("testReg error:reg must be a string type or reg must be instanceof RegExp");
            return false;
        }
    },
    valiEmailValue:function(valiValue){
        var reg = /^\w+([-+.]\w+)*@\w+([-.]\w+)*\.\w+([-.]\w+)*$/;
        return this.testReg(reg,valiValue);
    },
    valiPasswordValue:function(valiValue){
        var reg = /^[a-zA-Z]\w{5,15}$/;//6~16
        return this.testReg(reg,valiValue);
    },
    /**
     * [itemstrSplit]
     * @param  {[string]} item             []
     * @param  {[string]} strSplits        [strSplit]
     * @param  {[string]} strSplit         [strSplits]
     * strSplitstrSplitsitem
     * new RegExp(',%@,'.fmt(item)).test(",%@,".fmt(strSplits))
     * @return {[boolean]}                 [itemstrSplit]
     */
    checkItemInSplitStr:function(item,strSplits,strSplit){
        if(!strSplit){
            strSplit = ",";
        }
        //itemstrSplit
        return new RegExp('%@%@%@'.fmt(strSplit,item,strSplit)).test("%@%@%@".fmt(strSplit,strSplits,strSplit));
    },
    /**
     * [checkTimeDiffForStartEnd ]
     * @param  {[string]} startTime        []
     * @param  {[string]} endTime          []
     * @param  {[int]} maxDiff             []
     * @param  {[string]} interval         [H]
        interval D
        interval H
        interval M
        interval S
        interval T
     * @return {[boolean]}                 [trueFalse]
     */
    checkTimeDiffForStartEnd:function(startTime,endTime,maxDiff,interval){
        if (maxDiff > 0) {
            interval = interval ? interval : "H";
            var timeDiff = HOJS.lib.dateDiff(interval, startTime, endTime);
            if (Math.abs(timeDiff) > maxDiff) {
                console.warn("timeout");
                return false;
            }
            else {
                return true;
            }
        }
        else {
            return true;
        }
    },
    /**
     * [parseMillisecondsToDate ]
     * @param  {[float]} f []
     * @param  {[string]} start [1970-01-01]
     * @return {[Date]}       [formatre.format("yyyy-MM-dd hh:mm:ss.S")]
     */
    parseMillisecondsToDate:function(f,start){
        if(start){
            //winCE1904-01-01
            //new Date().getTimezoneOffset() * 60 * 10008
            return new Date(f + new Date(start.replace(/-/g,"\/")).getTime() - new Date().getTimezoneOffset() * 60 * 1000);
        }
        else{
            return new Date(f);
        }
    },
    copy: function(object, deep) {
        var ret = object,
            idx;

        // fast paths
        if (object) {
            if (object.isCopyable) return object.copy(deep);
        }

        switch ($.type(object)) {
            case "array":
                ret = object.slice();

                if (deep) {
                    idx = ret.length;
                    while (idx--) {
                        ret[idx] = HOJS.lib.copy(ret[idx], true);
                    }
                }
                break;

            case "object":
                ret = {};
                for (var key in object) {
                    ret[key] = deep ? HOJS.lib.copy(object[key], true) : object[key];
                }
        }

        return ret;
    },
    getUrlAnchor: function () {
        var re = "";
        var href = top.location.href;
        var index = href.indexOf("#");
        if (index > 0) {
            re = href.substring(index + 1);
        }
        return re;
    },
    arraySort: function(array, type, str) {
        /*  
            
             type  
             0  
             1  
             2  
             3  
             4  str  
         */
        switch (type) {
            case 0:
                array.sort();
                break;
            case 1:
                array.sort(function(a, b) {
                    return a - b;
                });
                break;
            case 2:
                array.sort(function(a, b) {
                    return a.localeCompare(b)
                });
                break;
            case 3:
                array.sort(function() {
                    return Math.random() > 0.5 ? -1 : 1;
                });
                break;
            case 4:
                array.sort(function(a, b) {
                    return a.indexOf(str) == -1 ? 1 : -1;
                });
                break;
            default:
                array.sort();
        }
    },
    deci: function(num, v) {
        /*
            
            num
            v
        */
        var vv = Math.pow(10, v);
        return Math.round(num * vv) / vv;
    },
    dateDiff: function(interval, date1, date2) {
        /*
            
            interval D
            interval H
            interval M
            interval S
            interval T
            :
            alert(dateDiff('D', '2007-4-1', '2007/04/19'))
        */
        if (interval && date1 && date2) {
            var objInterval = {
                'D': 1000 * 60 * 60 * 24,
                'H': 1000 * 60 * 60,
                'M': 1000 * 60,
                'S': 1000,
                'T': 1
            };
            var dt1 = (date1 instanceof Date) ? date1 : new Date(Date.parse(date1.replace(/-/g, '/')));
            var dt2 = (date2 instanceof Date) ? date2 : new Date(Date.parse(date2.replace(/-/g, '/')));
            try {
                return Math.round((dt2.getTime() - dt1.getTime()) / eval('objInterval.' + interval));
            } catch (e) {
                return -1;
            }
        } else {
            return -2;
        }
    },
    compareTime: function(startTime, endTime, isNotEnableEqual) {
        if (isNotEnableEqual) {
            return HOJS.lib.parseDate(endTime, true).getTime() - HOJS.lib.parseDate(startTime, true).getTime() > 0;
        } else {
            return HOJS.lib.parseDate(endTime, true).getTime() - HOJS.lib.parseDate(startTime, true).getTime() >= 0;
        }
    },
    parseDate: function(date, isForce) {
        if (typeof date == "string") {
            date = date.trim().replace(/-/g, '/');
            if (isForce) {
                date = date == "" ? new Date() : new Date(date);
                date = date instanceof Date ? date : new Date();
            } else {
                date = date == "" ? null : new Date(date);
                date = date instanceof Date ? date : null;
            }
        } else if (!(date instanceof Date)) {
            if (isForce) {
                date = new Date();
            } else {
                date = null;
            }
        }
        return date;
    },
    trim: function(str) {
        return str.replace(/(^\s*)|(\s*$)/g, "");
    },
    lTrim: function(str) {
        return str.replace(/(^\s*)/g, "");
    },
    rTrim: function(str) {
        return str.replace(/(\s*$)/g, "");
    },
    mult: function(str, count, noJoin) {
        //countstr
        if (typeof count !== "number" || count < 1) {
            return "";
        }
        var reStrs = [];
        for (var i = 0; i < count; i++) {
            reStrs.push(str);
        }
        if (noJoin) {
            return reStrs;
        } else {
            return reStrs.join("");
        }
    },
    /**
     * [parseHexsFromString description]
     * ASCII16
     * @param  {[string]} str []
     * @return {[hexs]}     [16]
     */
    parseHexsFromString: function(str) {
        //16ASCII
        //ASCII
        var reStrs = [],
            tempHex;
        for (var i = 0; i < str.length; i++) {
            tempHex = str.charCodeAt(i).toString(16);
            // reStrs.push(tempHex.length < 2 ? (0+tempHex) : tempHex);
            reStrs.push(tempHex);
        }
        return reStrs.join("").toUpperCase();
    },
    /**
     * [parseStringFromHex description]
     * 16ASCII
     * 
     * "5354415254""START"
     * @param  {[type]}  hexs      [16]
     * @return {[type]}           []
     */
    parseStringFromHexs: function(hexs) {
        //matchhexs"5354415254"["53", "54", "41", "52", "54"]
        //16ASCII
        //ASCII
        return hexs.match(/(\d|[a-fA-F]){2}/g).map(function(n) {
            return HOJS.lib.parseStringFromHex(n);
        }).join("");
    },
    /**
     * [parseStringFromHex description]
     * 16ASCII
     * 
     * @param  {[type]}  hex      [16]
     * @return {[type]}           []
     */
    parseStringFromHex: function(hex) {
        return String.fromCharCode("0x" + hex);
    },
    /**
     * [decodeENotation ]
     * 
     * @param  {[string]} str
     * @return {[string]}
     */
    decodeENotation:function(str){
        var regForTest,
            regForNum,
            regForCount;
        /**
         * [regForTest ]
         * @type {RegExp}
         */
        regForTest = /e/i;
        /**
         * [regForNum e]
         * @type {RegExp}
         */
        regForNum = /\d(?:\.\d+)*/;
        /**
         * [regForCount e]
         * @type {RegExp}
         */
        regForCount = /[+|-]\d+/;
        if(regForTest.test(str)){
            var num = str.match(regForNum)[0];
            var count = parseInt(str.match(regForCount)[0]);
            return num.replace(".","") + HOJS.lib.mult("0",count - num.length + 2);
        }
        else{
            return str;
        }
    },
    /**
     * [parseFloatFromHex description]
     * 16
     * 1622
     * ////////////////////////////////////////////////////////////////////////////////////////
     *                                                             
     *                          (S)     (E)     (M)          2     
     * (Singlefloat 1         8         23        32       7FH       +127=(2^(8-1)-1)
     * (Double)         1         11        52        64       3FFH      +1023=(2^(11-1)-1)
     * /////////////////////////////////////////////////////////////////////////////////////////
     * 
     * ////////////////////////////////////////////////////////////////////////////////////////
     * F=1.M()
     * 
     * V=(-1)^s*2^(E-127)*F
     * 
     * V=(-1)^s*2^(E-1023)*F
     * /////////////////////////////////////////////////////////////////////////////////////////
     * :
     * s
     * E10
     * FMF1.M
     * E'0'E=1-1271023= 1-(2^(8-1)-1)(2^(11-1)-1)F=0.M
     * E'0''1'E=E-1271023= E-(2^(8-1)-1)(2^(11-1)-1)F=1.M
     * /////////////////////////////////////////////////////////////////////////////////////////
     * 
     * E'0'V=(-1)^s*2^(1-(2^(e-1)-1))*0.M
     * E'0''1'V=(-1)^s*2^(E-(2^(e-1)-1))*1.M
     * s01e(E)811E(E)M
     * /////////////////////////////////////////////////////////////////////////////////////////
     * @param  {[type]}  hex   [16]
     * @param  {Boolean} isDouble []
     * @return {[number]}           []
     */
    parseFloatFromHex: function(hex, isDouble) {
        var e = 8;
        if (isDouble) {
            e = 11;
        }
        //hex16"C1480000"
        var twoStr = parseInt(hex, 16).toString(2); //16211000001010010000000000000000000
        twoStr = HOJS.lib.decodeENotation(twoStr);//ie
        //twoStr=100000001000111000101011111010010000111111111001011100000000000
        var needLength = 32, //23264
            curLength = twoStr.length;
        //curLength=63
        if (isDouble) {
            needLength = 64;
        }
        var needPadding = needLength - curLength; //22
        if (needPadding) {
            //
            twoStr = HOJS.lib.mult("0", needPadding) + twoStr;
            //twoStr=0100000001000111000101011111010010000111111111001011100000000000
        }
        var signStr = twoStr.charAt(0); //,10
        var sign = parseInt(signStr); //011-1
        //sign=0
        var powerStr = twoStr.substr(1, e), //810000010
            power, //
            tailStr = twoStr.substr(e + 1), //10010000000000000000000
            tail = 0, //
            tailPrefix; //,1.M1,0.M0
        //powerStr=10000000100
        //tailStr=0111000101011111010010000111111111001011100000000000
        if (!powerStr) {
            return 0.0;
        }

        if (powerStr == HOJS.lib.mult("0", e)) {
            //1-(2^(e-1)-1)0.M
            power = 1 - (Math.pow(2, e - 1) - 1);
            tailPrefix = 0;
        } else {
            //E-(2^(e-1)-1)1.M
            power = parseInt(powerStr, 2) - (Math.pow(2, e - 1) - 1); //3
            tailPrefix = 1;
            //power=5
        }

        var tempChar = "";
        //0.M1.MM
        //M=10010000000000000000000
        //1*2^(-1)+0*2^(-2)++0*2^(-3)+1*2^(-4)+0*2^(-5)+...
        for (var len = tailStr.length, i = len - 1; i >= 0; i--) {
            tempChar = tailStr.charAt(i);
            if (tempChar == "1") {
                tail += 1 * Math.pow(2, -1 * (i + 1));
            }
        }
        //tail0.5625
        //0.M01.M1
        tail += tailPrefix; //1.5625
        //tail=0.44286015624993524,sign=0
        //
        return Math.pow(-1, sign) * Math.pow(2, power) * tail; //-12.5
    }
}

